import React, { Component } from 'react';
import '../Css/Category.css';
import { NavLink } from 'react-router-dom';

class Category extends Component {
    render() {
        return (
            <div id='category_wrap'>
                <NavLink class='category' exact to = {'/search'}>
                    <button>냉장고</button>
                </NavLink>
                <NavLink exact to = {'/search'}>
                    <button class='category'>전공책</button>
                </NavLink>
                <NavLink exact to = {'/search'}>
                    <button class='category'>킥보드, 자전거</button>
                </NavLink>
                <NavLink exact to = {'/search'}>
                    <button class='category'>가구</button>
                </NavLink>
                <NavLink exact to = {'/search'}>
                    <button class='category'>옷</button>
                </NavLink>
                <NavLink exact to = {'/search'}>
                    <button class='category'>원룸</button>
                </NavLink>
            </div>
        )
    }
}

export default Category;
